    console.log(props.data.weather.description)

    return (
    <div>
        <div>{currentDate}</div>
        <div>{currentTime}</div>
        <div>{props.data.main.temp}</div>
        <div>{props.data.weather[0].main}</div>
        <div>{props.data.weather[0].description}</div>
    </div>
    )
}

